function CallingAPI3() {
  const [data, getData] = useState([])
  const URL = 'https://nh7shdbjz5.execute-api.ap-southeast-1.amazonaws.com/dev/chain'`$`;
  console.log(process.env)
  useEffect(() => {
      fetchData()
  }, [])

  const fetchData = () => {
      fetch(URL)
          .then((res) =>
              res.json())

          .then((response) => {
              console.log(response);
              getData(response);
          })

  }

  return (
      <div className='App'>
          <h1>Display JSON data in React JS (Calling API 3)</h1>
          <p>Message: {data.message}</p>
      </div>
  );
  }

